E_D("replace into `phome_ecms_game` values('10316','34','0','','','','1','admin','|11|','1','0','1343264780','0','0','0','0','','','10316','0','0','0','0','0','0','小女孩冒险','1343264780','/spic/20120726/10437.jpg','0','1','1343264780','0','3','1','0','','0','','/d/file/swf/2839.swf','667','479','\\\\\"很精美的解谜小游戏，帮助Anika完成探险。 <br />　　小女孩艾妮卡出去打水时，飞来一只老鹰把她的玩具兔子叼走了。 <br /><br /><br /><br />　　玩法：鼠标控制，帮助艾妮卡找回兔子吧！~ <br /><br />　　先把兔子放在木墩上，然后拎小水桶去打水，这时就会飞来一只老鹰叼走兔子。 <br /><br />　　部分攻略：把铁桶放在铁丝网边，站在桶上面跳出围栏。 <br /><br /><br />　　走到河边，钻进河上的木头里，来了3个小精灵，它们阻止小女孩去冒险，走到岸边树洞旁，把头钻一下，有个小精灵也钻进去看，踢一下它，让它掉进树洞，另外2个小精灵就会来救它，赶紧过河。 <br /><br /><br />　　后面的留给玩家自己摸索吧<br />\\\\\"<br />','1','','0','','1','/dpic/20120726/10438.jpg','2839','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBKTkUxNmEzVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/2839.swf','http://www.61baobao.com/common/flash/2010/dpic/2839.jpg','http://www.61baobao.com/common/flash/2010/pic/2839.jpg','0','三个月以上','0','','0','','0','0','0');");
